import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Portfolio = () => {
    const [prices,setPrices] = useState([]);
    // const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });
    useEffect(() => {
        let url = 'https://www.alphavantage.co/query?';
        let func = 'TIME_SERIES_INTRADAY';
        let symbol = 'MSFT';
        let apiKey = process.env.REACT_APP_ALPHA_VANTAGE_API_KEY;
        let interval = '5min';
        axios.get(`${url}function=${func}&symbol=${symbol}&interval=${interval}&apikey=${apiKey}`)
        .then(json => {
            return json.data['Time Series (5min)'];
        })
        .then(data => {
            console.log(Object.entries(data))
            // setPrices(Object.entries(data))
        });
    },[])

    // const getValues = () => {
    //     let microsoft
    //         microsoft = data['Time Series (1min)'];
    //         // console.log(Object.keys(data))
    //     });
    //     return microsoft;
    // }

    return (
        <div>
            {prices}
        </div>
    );
}
 
export default Portfolio;
